import React from 'react'

function HomePageLoggedIn({ user, setUser}) {
  return (
    <div>
        <h1>Welcome, {user}</h1>
        <p>You are logged in. Explore our amazing travel options here.</p>
    </div>
  )
}

export default HomePageLoggedIn
